function addPage(){Swal.showLoading();var n=$("#AddOrEditForm")[0],t=new FormData(n);$.ajax({type:"POST",url:"/sayfa-ekle",data:t,processData:!1,contentType:!1,dataType:"json",async:!0,success:function(n){Swal.hideLoading();n.ec==0?Swal.fire({title:"Başarılı!",text:"Statik Sayfa Kayıt/güncelleme başarıyla gerçekleşti.",icon:"success",confirmButtonText:"Tamam"}).then(function(){window.location.href="/statik-sayfalar"}):n.ec==-1&&Swal.fire({title:"Hata!",text:"Kayıt/Güncelleme sırasında hata oluştu.",icon:"warning",confirmButtonText:"Tamam"})}})}$(document).ready(function(){$("#summernote").summernote()});